package com.externalrepoproject.cascadedb;

/*This is a Studio Managed File. DO NOT EDIT THIS FILE. Your changes may be reverted by Studio.*/

import java.io.Serializable;
import java.util.Objects;

public class CompositeTableId implements Serializable {

    private String stringCol;
    private String charId;
    private Integer intId;

    public String getStringCol() {
        return this.stringCol;
    }

    public void setStringCol(String stringCol) {
        this.stringCol = stringCol;
    }

    public String getCharId() {
        return this.charId;
    }

    public void setCharId(String charId) {
        this.charId = charId;
    }

    public Integer getIntId() {
        return this.intId;
    }

    public void setIntId(Integer intId) {
        this.intId = intId;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (!(o instanceof CompositeTable)) return false;
        final CompositeTable compositeTable = (CompositeTable) o;
        return Objects.equals(getStringCol(), compositeTable.getStringCol()) &&
                Objects.equals(getCharId(), compositeTable.getCharId()) &&
                Objects.equals(getIntId(), compositeTable.getIntId());
    }

    @Override
    public int hashCode() {
        return Objects.hash(getStringCol(),
                getCharId(),
                getIntId());
    }
}